import './Header.css';
import { Link, useLocation } from 'react-router-dom';
import React from 'react';

function Header(){
    const location = useLocation();
    console.log(location.pathname);

    const item = styled.p`font-size: 1.4rem; font-weight: 500;font-family: "Heebo";margin-bottom: 0px;margin-top: 0px; color:${(location)=>(location.pathname == '/allCookies' ? "black" : "white") }`

    return(
        <div className='App-Bar'>
              <Link to="/">
                <img className="Logo"  src="img/logo.png"/>
              </Link>
              <div className='Menu'>
                <Link to="/" className='Cookies-Link'><div><p id='Home' style={item}>HOME</p></div></Link>
                <Link to="/prologue" className='Cookies-Link'><div><p style={item}>Prologue</p></div></Link>
                <Link to="/allCookies" className='Cookies-Link'><div><p style={item}>ALL COOKIES</p></div></Link>
                <Link to='/cookieDogTeam' className='Cookies-Link'><div><p style={item}>CookieDog Team</p></div></Link>
                <Link to='/'className='Cookies-Link'><div><p style={item}>Opensea</p></div></Link>
              </div>
              <div className='Connect-Wallet-Button'>connect wallet</div>
            </div>
    )
}

export default Header;
